import AvatarGuest from "./AvatarGuest";
import React from "react";
import progIcon from "./assets/prog.png";
import delintIcon from "./assets/HQ.png";
import hiringIcon from "./assets/hiring.png";
import birthIcon from "./assets/birth.png";
import situatIcon from "./assets/situat.png";
import trashIcon from "./assets/trash.png";
import "../style.css";

function Guest() {
  return (
    <div>
      <div className="guest-container">
        <AvatarGuest />
        <p className="guest-name">Sofia O'Sillivan</p>
        <div>
          <img src={trashIcon} alt="trash" />
        </div>
      </div>
    </div>
  );
}

export default Guest;
